import css from "./DaySell.css"

export function DaySell({day}) {
    return (
        <div className={`${css} weekend`}>
            <div className={`${css} row`}>
                <div className={`${css} day`}>
                    {day.format('D')}
                </div>
            </div>
        </div>
    )
}
